import React from 'react';
import { useNavigate } from 'react-router-dom';
// Ensure Tailwind CSS is correctly imported in your project setup
import Navbar from "../navbar/Navbar.jsx";


function Login() {
    // Prevent form submission for demonstration purposes
    const handleLogin = (event) => {
      event.preventDefault();
      // Here you would typically handle the login logic
    };

    return (
        <div className="flex flex-wrap h-screen items-center justify-center">
          {/* Login Section */}
          <div className="w-full max-w-md">
            <div className="flex justify-center mb-6">
              <a href="#" className="text-black font-bold text-xl p-4">Logo</a>
            </div>
    
            <div className="bg-white shadow-md rounded px-8 pt-6 pb-8 mb-4">
              <p className="text-center text-3xl mb-4">Welcome.</p>
              <form className="flex flex-col" onSubmit={handleLogin}>
                <div className="mb-4">
                  <label htmlFor="email" className="block text-gray-700 text-sm font-bold mb-2">Email</label>
                  <input type="email" id="email" placeholder="your@email.com" className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" />
                </div>
    
                <div className="mb-6">
                  <label htmlFor="password" className="block text-gray-700 text-sm font-bold mb-2">Password</label>
                  <input type="password" id="password" placeholder="Password" className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 mb-3 leading-tight focus:outline-none focus:shadow-outline" />
                </div>
    
                <div className="flex items-center justify-between">
                  <button type="submit" className="bg-black text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline hover:bg-gray-700">Log In</button>
                  <a href="/register" className="inline-block align-baseline font-bold text-sm text-blue-500 hover:text-blue-800">Register here.</a>
                </div>
              </form>
            </div>
          </div>
    
          {/* Image Section */}
          <div className="absolute top-0 right-0 bottom-0 left-0 z-0">
            <img className="object-cover w-full h-full" src="https://source.unsplash.com/IXUM4cJynP0" alt="Login Background" />
          </div>
        </div>
      );
    }

export default Login;
